import "./Style.css";

function LandingPage() {
  const backgroundImage = require("../img/background.png").default;
  return (
    <div
      className="landing"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <img src={backgroundImage} alt="icon" />
    </div>
  );
}

export default LandingPage;
